window.bookSummaryJSON = "<p>In All Wars, Loss Is Inevitable.</p> <p>Matt has beaten another enemy Lord, acquired even more towns. He’s establishing a foothold in this crazy afterlife of his, doing battle on multiple fronts and winning.</p> <p>But victory isn’t always guaranteed, there’s always a price to be paid when you face another on the field of battle.</p> <p>For Matt Fang, that time is coming soon. And the only question is will it break him or will he continue to be the shield that humanity requires.</p> <p>Magic Kingdom at War is a tactical, base-building, crunchy LitRPG novella series by Tao Wong, bestselling author of the System Apocalypse, A Thousand Li, Climbing the Ranks, the Hidden Universe and Adventures on Brad series.</p>"; 
